    false,nt"url": null,nt"notes": "This is the last report in the initial
    series dealing with waterfowl habitat supply-waterfowl demand determinations. In
    it, potential-for-use throughout the 48 coterminous United States estimated for
    the Year 2000 is compared with migration and wintering waterfowl demand at Target
    I levels, and differences determined. The results identify the location and magnitude
    of migration and wintering habitat deficiency problems likely in the Year 2000,
    with waterfowl populations at maximum foreseeable demand.",nt"license_title":
